        }

        fire_fast_start -= 3;
        if (fire_fast_start < 0) {
            fire_fast_start = 12;
        }
    }

    if (elapsed_tocks(time, last_cycle_fast) >= COLOR_CYCLE_PERIOD_FAST * cycle_speed_factor) {
