            palette[paletteIndex++] = monitors[index];
        }

        monitors_start -= 3;

        if (monitors_start < 0) {
            monitors_start = 12;
        }
    }

    if (elapsed_tocks(time, last_cycle_very_fast) >= COLOR_CYCLE_PERIOD_VERY_FAST * cycle_speed_factor) {
        changed = true;
        last_cycle_very_fast = time;

        if (bobber_red == 0 || bobber_red == 60) {
